import React from 'react';
import styled from 'styled-components';
import TextoDestacado from '../TextoDestacado';
import Texto from '../Texto';
import Walee from '../../images/walle.png';
import imagemApresentacao from '../../images/imagem_apresentacao.webp'

const ContainerApresentacao = styled.div`
  width: 100vw;
  height: 100vh;
  @media (max-width: 768px) {
    height: auto;
  }
`;

const WaleeImg = styled.img`
  display: flex;
  padding: 0 150px;
  margin-left: auto;
  @media (max-width: 768px) {
    padding: 0 50px;
    width: 100%;
  }
`;

const Deladin = styled.div`
  display: flex;
  unicode-bidi: isolate;
  flex-direction: row;
  @media (max-width: 768px) {
    flex-direction: column;
  }
`;

const IntroImg = styled.img`
  display: flex;
  padding: 0 130px;
  margin-right: 0;
  margin-top: 50px;
  width: 724px;
  height: 599px;
  @media (max-width: 768px) {
    padding: 0 20px;
    width: 100%;
    height: auto;
  }
`;

const TextoDiv = styled.div`
  display: flex;
  flex-direction: column;
  padding: 0 250px;
  margin-left: auto;
  margin-right: 0;
  row-gap: 20px;
  @media (max-width: 768px) {
    padding: 0 20px;
    margin-left: 0;
  }
`;

function Apresentacao() {
  return (
    <ContainerApresentacao>
      <Deladin>
        <IntroImg src={imagemApresentacao} alt="Apresentação" />
        <TextoDiv>
          <TextoDestacado />
          <Texto />
        </TextoDiv>
      </Deladin>
      <WaleeImg src={Walee} alt="Walee" />
    </ContainerApresentacao>
  );
}

export default Apresentacao;
